INSERT INTO `inspeccion` (`id_inspeccion`, `id_vehiculo`, `id_tecnico`, `id_contacto`, `fecha`, `ubicacion`, `notas`, `contacto`, `registro`) VALUES
(1, '4XATH76A0D2293222', '1711938025', 3, '2013-08-27 00:00:00', 'Latacunga', 'Informe Inspección Vehículo\r\n\r\n\r\nLatacunga, 27 de Agosto del 2013\r\n\r\n\r\nSe procede a la inspección del vehículo con VIN 4XATH76A0D2293222 mismo que presenta lo siguiente:\r\n\r\n•	Muestra un golpe en la parte delantera derecha producido por un impacto, mismo que rompe el guarda fangos derecho, y una pequeña parte del guarda choques, el golpe afectó la posición del faro.\r\n  \r\n•	Tiene el parabrisas roto.\r\n \r\n•	Se revisa el sistema de aceleración, niveles de fluidos y el sistema eléctrico mismos que no presentan ninguna novedad.\r\n•	Motor funcionando correctamente.\r\n\r\n\r\n\r\nAtentamente:\r\n\r\n\r\n\r\nGalo Sinchiguano\r\n\r\n\r\n\r\n\r\n\r\n', NULL, '2013-10-02 01:06:54'),
(2, '4XATH76A4D2290761', '0803550466', 3, '2013-09-19 00:00:00', 'Cotopaxi, la Mana', '\r\nInforme Inspección Vehículo\r\n\r\nCotopaxi, La Mana, 19 de Septiembre de 2013\r\n\r\nSe procede con la inspección del vehículo con número de VIN  4XATH76A4D2290761,  a cargo del Ing. Henry Peñaherrera, mismo que presenta un golpe en la parte frontal derecha producto del golpe presenta el guarda choque doblado hacia dentro, se realiza una inspección completa de acuerdo al siguiente detalle:\r\n\r\nInspección	Observaciones\r\nCarrocería	Tiene roto el guarda fango derecho\r\nPuertas	Funcionando correctamente.\r\nCajón abatible	Funcionando correctamente\r\nEstructura Cabina	No presenta golpes\r\nTerminales Suspensión	Funcionando correctamente.\r\nAmortiguadores	Funcionando correctamente.\r\nTerminales de dirección	Funcionando correctamente.\r\nBrazos de Suspensión	Funcionando correctamente.\r\nGuardachoque	Presenta doblamiento en la parte izquierda.\r\nBatería	Funcionando correctamente\r\nCableado eléctrico	Funcionando correctamente..\r\nLimpia-brizas	Funcionando correctamente.\r\nCaja engranaje delantera	Funcionando correctamente.\r\nCajas engranaje posterior	Funcionando correctamente.\r\nAceite Motor	Cambiado\r\nAceite Caja Posterior	Cambiado\r\nAceite Caja Delantera	Cambiado\r\nLiquido de Frenos	Llenado completo\r\nRefrigerante	Cambiado\r\nÁcido batería	Funcionando perfectamente\r\nFiltro aire	Funcionando correctamente\r\nFiltro Aceite	Cambiado\r\nImágenes vehículo:\r\n\r\n\r\n\r\n\r\n\r\nObservaciones:\r\n•	Presenta doblamiento en la parte izquierda del guarda choque.\r\n•	Presentar rotura en la parte superior izquierda de la mascarilla.\r\n•	Se derramo el líquido de freno en un 70% a 80% estimado quedándose con el porcentaje mínimo de liquido para ser frenado.\r\n\r\n\r\nNota: Se realiza el mantenimiento completo del vehículo.\r\n\r\n\r\nResponsabe zonal: Ing. Xavier Moya (03-2812 986), Dirección Provincial Agropecuaria de Cotopaxi Latacunga Av Atahualpa y zamora\r\n\r\n\r\n\r\n\r\n\r\nAtentamente:\r\n\r\n\r\n\r\nTec. Eduardo Villota\r\nCI: 172291972-5\r\n\r\n\r\n', NULL, '2013-10-02 01:06:54'),
(3, '4XATH76AXD2290828', '1711938025', 4, '2013-09-18 00:00:00', 'Tunguragua, Quinchicoto', 'Informe Inspección Vehículo\r\nTungurahua, Quinchicoto 18 de septiembre del 2013\r\nEn la zona de Quinchicoto provincia de Tungurahua se procede con la inspección del vehículo con VIN  4XATH76AXD220828 a cargo del Ing. Luis Soliz, este vehículo presenta un sonido en la caja de cambios posterior, el sonido se produce, en el momento que se cambia de marcha, cuando inicia el recorrido,se realiza una inspección completa de acuerdo al siguiente detalle:\r\nInspección	Observaciones\r\nCarrocería	Funcionando correctamente.\r\nPuertas	Funcionando correctamente.\r\nCajón abatible	Funcionando correctamente\r\nEstructura Cabina	Funcionando correctamente.\r\nTerminales Suspensión	Funcionando correctamente.\r\nAmortiguadores	Funcionando correctamente.\r\nTerminales de dirección	Funcionando correctamente.\r\nBrazos de Suspensión	Funcionando correctamente.\r\nGuardachoque	Funcionando correctamente.\r\nBatería	Funcionando correctamente\r\nCableado eléctrico	Funcionando correctamente..\r\nLimpia-brizas	Funcionando correctamente.\r\nCaja engranaje delantera	Funcionando correctamente.\r\nCajas engranaje posterior	Funcionando correctamente.\r\nAceite Motor	Completo\r\nAceite Caja Posterior	Completo\r\nAceite Caja Delantera	Completo\r\nLiquido de Frenos	Completo\r\nRefrigerante	Completo\r\nÁcido batería	Funcionando perfectamente\r\nFiltro aire	Funcionando correctamente\r\nFiltro Aceite	Completo\r\nNotas: Se realizó el chequeo respectivo  del vehículo , analizando las siguiente , piezas  que verificó , las cruceta , los ejes trasero , o algún tornillo flojos , estas piezas estaban bien, y el sonido seguía  presente en el vehículo\r\nEl vehículo apenas cumple 6 horas de trabajo motivo por el cual no se puede hacer el cambio de aceites respectivos.\r\nEl encargado zonal solicita de manera cordial se realice el traslado a Quito inmediatamente para el arreglo del vehículo.\r\nConclusión:  Desarmar la caja de cambio para revisar los engranajes.\r\nResponsable Zonal: Dr. Jorge Cifuentes Carrión  (03-2827383) Dirección Provincial Agropecuaria del Tungurahua Av. 12 de noviembre cc. Ambato Bloque No.2 Segundo Piso.\r\nAtentamente:\r\n\r\nEduardo Villota\r\n172291972-5\r\n', 'Dr. Jorge Cifuentes Carrión  (03-2827383)', '2013-10-02 01:10:03'),
(4, '4XATH76A6D2291121', '0803550466', 4, '2013-08-01 00:00:00', 'Ambato', '\r\nInforme Vehículo Polaris Volcado\r\n\r\n\r\nAmbato, 01 de Agosto del 2013\r\n\r\n\r\nEl vehículo Polaris con numero de VIN 4XATH76A6D2291121 sufrió un volcamiento por la parte delantera izquierda, resultado de una posible perdida de pista, presenta un golpe en la parte superior izquierda del parabrisas provocando la ruptura del vidrio, la cabina se encuentra desviada hacia atrás en la dirección del golpe aproximadamente 3cm.\r\n\r\nGráfico del golpe visto desde la parte frontal de la cabina\r\n\r\n\r\nSe realizó un chequeo completo de los sistemas, encontrando las siguientes novedades:\r\n\r\nInspección	Observaciones\r\nCarrocería	Presenta golpes en el lugar del impacto, pero no presenta ningún daño\r\nPuertas	Funcionando correctamente.\r\nCajón abatible	Funcionando, presenta una torcedura en el mango derecho\r\nEstructura Cabina	Presenta una desviación en dirección al golpe de unos 3cm\r\nTerminales Suspensión	Funcionando correctamente.\r\nAmortiguadores	Funcionando correctamente.\r\nTerminales de dirección	Funcionando correctamente.\r\nBrazos de Suspensión	Funcionando correctamente.\r\nWincha	Funcionando correctamente.\r\nBatería	Funcionando correctamente, presenta un baja en la carga por perdida de ácido.\r\nCableado eléctrico	Funcionando correctamente.\r\nLimpia-brizas	Funcionando correctamente.\r\nCaja engranaje delantera	Funcionando correctamente.\r\nCajas engranaje posterior	Funcionando correctamente.\r\nAceite Motor	Cambiar\r\nAceite Caja Posterior	Correcto\r\nAceite Caja Delantera	Correcto\r\nLiquido de Frenos	Vacío\r\nRefrigerante	Vacío\r\nÁcido batería	Por completar\r\nFiltro aire	Cambiar, se encuentra cubierto de aceite\r\nFiltro Aceite	Cambiar\r\n\r\n\r\nObservaciones Adicionales:\r\n\r\n1.	El aceite del motor se derramó en un 30% a 40 % encontrándose principalmente en los ductos de entrada de aire al motor.\r\n2.	Se chequea la alineación de las llantas sin encontrar ninguna novedad.\r\n\r\n\r\nResponsable Zonal: Dr. Jorge Cifuentes Carrión  (03-2827383) Dirección Provincial Agropecuaria del Tungurahua Av. 12 de noviembre cc. Ambato Bloque No.2 Segundo Piso.\r\n\r\nAtentamente:\r\n\r\n\r\n\r\n\r\nTec. Eduardo Villota\r\nCI: 172291972-5\r\n', 'Responsable Zonal: Dr. Jorge Cifuentes Carrió', '2013-10-02 01:15:09');
