INSERT INTO `viaje` (`id_viaje`, `fecha_salida`, `fecha_regreso`, `nro_vehiculos`, `provincias_destino`, `valor_caja`, `informe`, `registro`) VALUES
(1, '2013-07-22 00:00:00', '2013-10-24 00:00:00', 7, 'Cañar', 200.00, 'Quito  22 de julio  2013\r\n \r\n                                  REPORTE DE TRABAJO\r\n\r\nSalida  de Quito 3:30 am dirigiéndonos  a muestro lugar de trabajo, la novedad fue en trascurso del viaje, que la autopsita   surgió  un accidente vehicular, y nos tocó coger la carretera Ambato. \r\n\r\nPara llegar al lugar establecido para hacerle manteamiento a los vehículos.\r\nLlegada al  suscal , vía Azogues  12: 45  PM y nos dirigimos  al colegio Anbrosis Andrade y procedimos a realizar con el manteamiento establecido  por el ING.GUSTAVO VACA, y cumpliendo con el cronograma de trabajo .\r\n\r\nVehículo\r\nLugar \r\nFecha \r\nPeriodo\r\nEstado \r\nObservaciones\r\n4XATH76A7D4315592\r\nCAÑAR-SUSCAL \r\n23/07/2013\r\n50.H\r\n\r\nNinguna \r\n4XATH76A9D4315562\r\nNinguna\r\n4XATH76A2D4315550\r\nNinguna\r\n4XATH76A8D4315598\r\nNinguna\r\n   \r\n Quito 23 de julio \r\n\r\nEntada al trabajo a las 8:00 am, y procedimos a terminar el ultimo vehículo, pendiente en  el CAÑAR –SUSCAL, nos dirigimos a La Trocal a realizar los trabajos  pendiente  de los dos  vehículos.\r\n\r\nVehículo\r\nLugar \r\nFecha \r\nPeriodo\r\nEstado \r\nObservaciones\r\n4XATH76A5D4315591\r\nLA TRONCAL \r\n23/07/2013\r\n50.H\r\n\r\nAceite de la caja delantera:\r\nNos presenta el siguiente  detalle  al momento  de cambiar el aceite, el Aceite con limallas  con dos objetos muy pequeños, trozos de aluminio.\r\n\r\nEn la parte  trasera del eje , de rueda derecha , procedimos a colocar grasa , en eje de en gramaje , y una abrazadera de acero  en la parte  del caucho que cubre  el eje.\r\n4XATH76A7D4315575\r\nNinguna\r\nQuito 24 de julio\r\nCulminación del trabajo  y del  manteamiento de vehículos POLARIS,  y regreso a QUITO, para la  entrega del vehículo, alquilado.\r\n\r\nEste el problema que presta los vehículos en  zona de la Troncal me supieron informa que era los do vehículo que tienes el mismo problema .\r\n El problema: el problema que podemos observar son los cauchos  de suspensión trasera que  se rompieron . ', '2013-10-25 17:04:32'),
(2, '2013-08-21 00:00:00', '2013-10-23 00:00:00', 20, 'Chimborazo', 200.00, 'MIERCOLES 21 AGOSTO 2013\r\nSolidad de QUITO 4 am y nos dirigimos a Riobamba  al centro de agricultura y pesca , a realizar el manteniendo  establecido en el cronograma . \r\nY nos dirigimos a  GUANO a realizar el manteniendo a los vehículos. Y retomarnos a RIOBAMBA a las 7.40 pm pasar la noche.\r\n4XATH76A6D2293208\r\nRIOBAMBA \r\n4XATH76A5D2293216\r\nRIOBAMBA\r\n4XATH76A5D4317678\r\nRIOBAMBA\r\nEsto vehículos  se le hizo el manteamiento   y cambio de aceite  a los tres vehículos \r\nGUANO\r\n4XATH76A1D2290779\r\nGUANO   \r\n4XATH76A9D2293199\r\nGUANO\r\n4XATH76A0D2293253\r\nGUANO\r\n4XATH76A4D2291120\r\nGUANO\r\n4XATH76A3D2290749\r\nGUANO\r\nA estos  vehículo le  adatada ron los siguientes   objetos. Pitos  retrovisores (delanteros y traseros) guías traseras  neblineros delanteros .\r\n( 4XATH76A1D2290779) (4XATH76A4D2291120) (4XATH76A3D2290749)\r\n22 DE AGOSTO 2013\r\nSalida de RIOBAMBA  a las 7:40  AM  y nos dirigimos a COLTA a cumplir el manteamiento establecido. \r\nY salidad desde COLTA 1:30  PM y nos dirigimos a ALAUSI llegada 3:10 PM a proceder el manteniendo hora de terminar el manteniendo 6.30 PM y nos dirigimos a CHUNCHI  a pasar la noche \r\nCOLTA\r\n4XATH76A2D4317668\r\nCOLTA\r\n4XATH76A6D2290745\r\nCOLTA\r\n4XATH76A4D2290808\r\nCOLTA \r\n4XATH76A1D2290751\r\nCOLTA\r\n4XATH76A2D4317640\r\nCOLTA\r\nEsto vehículos  se le hizo el manteamiento   y cambio de aceite .\r\nALAUSI\r\n4XATH76A7D4317665\r\nALAUSI\r\n4XATH76A4D2290825\r\nALAUSI\r\n4XATH76A6D2290759\r\nALAUSI\r\n4XATH76A9D2291114\r\nALAUSI\r\nSolo se realizó los chuequeo respectivos  del vehículos  .No se realizó el cambio de aceite\r\n(4XATH76A7D4317665)\r\nA estos  vehículo le  adatada ron los siguientes   objetos. Pitos  retrovisores (delanteros y traseros) guías traseras  neblineros delanteros .\r\n(4XATH76A4D2290825)  (4XATH76A6D2290759)  (4XATH76A9D2291114)\r\n\r\n23 DE AGOSTO 2013\r\nRealizamos el manteamiento a los vehículos   Y salimos desde CHUNCHI  a las 11.30 ,\r\nY nos dirigimos  a LASSO  a llegada a LASSO a 3.30cumplir el ultimo manteniendo y salida para QUITO  \r\nCHUNCHI\r\n4XATH76A0D4317667\r\nCHUNCHI\r\n4XATH76A4D2290792\r\nCHUNCHI\r\nEsto vehículos  se le hizo el manteamiento   y cambio de aceite .\r\n (4XATH76A0D4317667)\r\nA estos  vehículo le  adatada ron los siguientes   objetos. Pitos  retrovisores (delanteros y traseros) guías traseras  neblineros delanteros .\r\nTenía dañado  el caucho del eje  trasero de la rueda. Y procedimos a la reparación del caucho, a coser el caucho con una piola y cubrir con una cinta  alrededor  Al del caucho del eje trasero. \r\nA este vehículo no se cambió el aceite , del motor , de caja delantera, caja de trasmisión \r\n(4XATH76A4D2290792)\r\nLASSO\r\nEsto vehículos  se le hizo el manteamiento   y cambio de aceite .\r\n4XATH76A7D2291063\r\n26 DE AGOSTO 2013\r\nSolidad de QUITO 9:20 am y nos dirigimos a SIGCHOS   al centro de agricultura y pesca , a realizar el manteniendo  establecido en el cronograma . \r\n4XATH76A0D2293205\r\nSe le completo el Líquido de freno , líquido  refrigerante  , tuerca  trasera dañada.\r\n Y  se envió un 1.L aceite  del motor para el vehículo . que estaba  con el problema del aceite bajo. en pueblo de PALO QUEMADO  para que completen el nivel de aceite  \r\n27 DE AGOSTO 2013\r\nSolidad de QUITO 9:40 am y nos dirigimos a LATACUNGA     al centro de agricultura y pesca , a realizar el manteniendo  establecido en el cronograma . y nos dirigimos a PULIJI para verificar el vehículo que tuvo el accidente \r\nEl vehículo  tiene  cambiado   dos  tuercas, de  la rueda trasera, por  dos turcas  de roscas diferente porque cuando  estaban cambiando la rueda  se aislaron  las  tuercas y la válvula  de la rueda ya también fue relanzada  por una de aluminio \r\n4XATH76AXD2291073\r\n PUJILI \r\nEste   vehículo  se le reviso  el sistema  de aceleración y comprobamos los  niveles de líquidos, aceite, freno y refrigerante.\r\n Y no se  cambió del aceite  del motor , caja delantera  , caja de transición \r\n4XATH76A0D2293222\r\nA este  fue del problema que se quedó acelerado y se golpeó con otro vehículo.', '2013-10-25 17:12:03'),
(3, '2013-08-26 00:00:00', '2013-10-27 00:00:00', 2, 'Cotopaxi', 50.00, '26 DE AGOSTO 2013\r\nSolidad de QUITO 9:20 am y nos dirigimos a SIGCHOS   al centro de agricultura y pesca , a realizar el manteniendo  establecido en el cronograma . \r\n\r\n4XATH76A0D2293205\r\nSe le completo el Líquido de freno , líquido  refrigerante  , tuerca  trasera dañada.\r\n Y  se envió un 1.L aceite  del motor para el vehículo . que estaba  con el problema del aceite bajo. en pueblo de PALO QUEMADO  para que completen el nivel de aceite  \r\n27 DE AGOSTO 2013\r\nSolidad de QUITO 9:40 am y nos dirigimos a LATACUNGA     al centro de agricultura y pesca , a realizar el manteniendo  establecido en el cronograma . y nos dirigimos a PULIJI para verificar el vehículo que tuvo el accidente \r\nEl vehículo  tiene  cambiado   dos  tuercas, de  la rueda trasera, por  dos turcas  de roscas diferente porque cuando  estaban cambiando la rueda  se aislaron  las  tuercas y la válvula  de la rueda ya también fue relanzada  por una de aluminio \r\n4XATH76AXD2291073\r\n PUJILI \r\nEste   vehículo  se le reviso  el sistema  de aceleración y comprobamos los  niveles de líquidos, aceite, freno y refrigerante.\r\n Y no se  cambió del aceite  del motor , caja delantera  , caja de transición \r\n4XATH76A0D2293222\r\n A este  fue del problema que se quedó acelerado y se golpeó con otro vehículo.', '2013-10-25 17:17:39'),
(4, '2013-08-09 00:00:00', '2013-10-09 00:00:00', 2, 'Cotopaxi', 50.00, 'Informe Viaje Mantenimiento\r\n\r\nInforme No: IV-2013-04\r\nQuito, 10 de agosto 2013\r\nFecha Salida:  09 de Agosto del 2013\r\nFecha Retorno: 09 de Agosto del 2013\r\nTécnicos: Eduardo Villota, Galo Sinchiguano\r\nProvincias de Destino: Cotopaxi\r\nNro. De Vehículos: 2 vehículos\r\nValor de Caja: 50\r\n\r\nHistorial de Mantenimientos:\r\nSe realiza el mantenimiento de dos vehículos cerca a Latacunga\r\n\r\nÍtem\r\nLugar\r\nCantidad\r\n1\r\nGuangaje\r\n1\r\n2\r\nPujili\r\n1\r\n\r\nNovedades:\r\nVIN: 4ATH76A4D2290713\r\nVehículo con el tapón dañado, se aíslo la cabeza del tapón de la caja delantera\r\nAtentamente: \r\nEduardo Villota', '2013-10-25 17:36:03'),
(5, '2013-09-10 00:00:00', '2013-10-11 00:00:00', 3, 'Cotopaxi', 40.00, 'QUITO 11 SEPTIEMBRE 2013\r\nEn la provincia de Cotopaxi  - LA ESPERANZA (tingo) nos dirigimos a realizar el último mantenimiento  del  vehículo, a cargo de DR. VANESSA ALAJO.\r\nVIN: 4XATH76A0D4317684\r\nObservación:\r\nComo podemos observar las fotos con cables cortados, era  el causante  del problema que se encendía  la luz roja del aceite, luego de hacer las respectivas pruebas   sobre el sistema electrónico del vehículo, el problema de la luz roja del aceite no se apagaba. Procedimos  a  la reparación del daño uniendo  los cables con sus colores respectivos, luego de terminar con el arreglo., la luz roja del aceite ya desapareció \r\nObservaciones generales:\r\nEste cable cortado  un cable muy importante  porque conectad con los sensores de aceite, temperatura.\r\n                        REPORTE DE MANTENIMIENTO POLARIS \r\nSe realizó el  mantenimiento 3 vehículos  con las reglas establecidas en la provincia de COTOPAXI.\r\nVEHÍCULO\r\nLUGAR \r\nFECHA \r\nPERIODO\r\nOBSERVACIONES\r\n4XATH76A6D4317687\r\nTanicuchi-Cotopaxi\r\n23/07/2013\r\n60.H\r\nMantenimiento completo, El aro de la rueda derecha se encuentra doblada un poco en parte de abajo. Y se ajustó el tornillo del desfogue del motor.\r\n4XATH76A5D2292065\r\nCanchagua-Cotopaxi\r\n61.H\r\nMantenimiento completo, El filtro tenía mucho polvo.\r\n4XATH76A0D4317684\r\nLa esperanza(tingo)-Cotopaxi \r\n52.H\r\nMantenimiento completo, Tenía cortados los cables que conectan con los sensores, del aceite, temperatura. \r\n\r\nOBSERVACIONES:\r\nSe le entrego SR. JAVIER  MOYA  2 LTS aceite del motor  los siguientes SR.\r\nIng. Alba zarita. 1.LTS\r\nSr. Romel  Cevallos . 1.LTS \r\nLa entrega de estos 2 lts  era para completar el nivel de aceite, para que sigan trabajando por que no cumplen las 50 .horas establecidas para el cambio de aceite.\r\nAtentamente:\r\n\r\nTec. Galo Sinchiguano                                           Marcos llumiquinga \r\n\r\n\r\n', '2013-10-25 17:44:10'),
(6, '2013-09-16 00:00:00', '2013-09-20 00:00:00', 16, 'Tungurahua', 220.00, ' 17  SEPTIEMBRE  2013\r\nSalida de QUITO  las 8:00 am, y nos dirigimos  a  realizar  los mantenimiento   establecido  en la provincia  de Tungurahua- Ambato.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n17/09/2013\r\nPillarlo \r\nTungurahua \r\n3\r\n\r\nObservación: en la provincia  de Tungurahua – Ambato  sin novedad.\r\n18 SEPTIEMBRE 2013\r\nSalida de AMBATO  a  PELILEO a las 7:30 am   a realizar el mantenimiento establecido en  el cronograma. \r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n18/09/2013\r\nPELILEO-QUINCHICOTO- YANAYACU–CEVALLOS– PILAHUIN –QUISAPINCHA \r\nTungurahua \r\n8\r\nObservación:En la zona de Quinchicoto, el siguiente vehículo: 4XATH76AXD220828presenta un sonido en la parte  trasera, del vehículo,  este sonido se produce  al momento que el vehículo se pone en marcha, y recorre a cierta velocidad. Y se realizó el chequeo respectivo  del vehículo , analizando las siguiente , piezas se verificó , las cruceta , los ejes trasero , o algún tornillo flojos , estas piezas estaban bien, y el sonido seguía  presente en el vehículo .\r\nY el encargado de la zona de Tungurahua – Ambato decidió que el vehículo se trasportado  a QUITO para que se realice un chequeo íntegro.\r\nObservación:En PELILEO el siguiente vehículo:4XATH76A8D2290830, este vehículo  se recalentó, no tenía refrigerante y se colocó 3 litros de refrigerante, no presentaba  ninguna  falla del motor. \r\n19 SEPTIEMBRE 2013\r\nSalida  de AMBATO –PULIJI  a las 8:am no dirigimos  la provincia de Cotopaxi –LA MANA   a realizar los manteamiento establecido en el cronograma  , en trascurso del camino  de vía PULIJI  para LA MANA  , la novedad fue que la vía estaba cerrada  por un derrumbé  , nos tocó  esperar  hasta que la vía se habilite .\r\nY llegada  a LA MANA 2:40 pm   a realizar el mantenimiento establecido.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n19/09/2013\r\nLa mana \r\nCOTOPAXI \r\n2\r\nObservación: sin novedad. \r\n20  septiembre 2013\r\nSalida de LA MANA – MORASPUNGO  a las 7:30 am   a realizar el mantenimiento establecido en  el cronograma en la zona del corazón.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n19/09/2013\r\nMORASPUNGO \r\nCOTOPAXI \r\n1\r\n19/09/2013\r\nEL CORAZÓN \r\nCOTOPAXI \r\n3\r\n\r\nObservación:Este vehículo:4XATH76A0D2291101 tiene un problema cuando se enciende el vehículo  las luces trasera se enciende y no se pagan.\r\n    19 septiembre 2013\r\nVEHÍCULOS ACCIDENTADOS\r\nEste  vehículo: 4XATH76A4D2290761 accidentado  en LA MANA presenta los siguientes daños:\r\n1) Prestada el dañado el frente delantero del guarda choque.\r\n2) Tiene dañado la superficie izquierda  de la mascarilla.\r\n3)  Y no presenta daños  mayores en elvehículo.\r\n18 septiembre 2013\r\n                                      VEHÍCULOS  PARA REVISIÓN COMPLETA \r\nEn la zona de Quinchicoto, el siguiente vehículo: 4XATH76AXD220828 presenta un sonido en la parte  trasera, del vehículo,  este sonido se produce, al momento que el vehículo se pone en marcha, y recorre a cierta velocidad.\r\n Y se realizó el chequeo respectivo  del vehículo , analizando las siguiente , piezas  que verificó , las cruceta , los ejes trasero , o algún tornillo flojos , estas piezas estaban bien, y el sonido seguía  presente en el vehículo .\r\nObservación: El encargado de  zona de Tungurahua – quiere transportar el vehículo  para la cuidad de QUITO para realizar la reparación  del sonido del vehículo.\r\nLuego de  observar  y analizar el sonido que presentaba el vehículo, la conclusión final es desarmar la caja de cambio para revisar los engranajes, para ver si están en su estado normal.', '2013-10-25 17:46:50'),
(7, '2013-10-02 00:00:00', '2013-10-04 00:00:00', 14, 'Cañar', 200.00, 'Informe Viaje Mantenimiento\r\nInforme No: IV-2013-07\r\nQuito, 05 de Octubre del 2013\r\nFecha Salida: 2de Octubre del 2013\r\nFecha Retorno: 4de Octubre del 2013\r\nTécnicos: Marco Llumiquinga, Galo Sinchiguano\r\nProvincias de Destino: Azogues\r\nNro. De Vehículos: 15 vehículos\r\nValor de Caja: \r\nHistorial de Mantenimientos:\r\n5 de Octubre del 2013 (azogues)\r\nSalida de Quito a las 06 00 con destino a azogues  realizando el manteamiento  a 2 vehículos, y  1  reparación del caucho o  guarda grasa  del eje trasero derecho realizados en los siguientes lugares:\r\nÍtem\r\nLugar\r\nCantidad\r\n1\r\nshut\r\n1\r\n2\r\nsuscal\r\nCaucho  reparar\r\n3\r\npicalpata\r\n1\r\nSalimos a  cañar para pasar la noche.\r\n3 de Octubre del 2013 (azogues)\r\nEn cañar   5 mantenimientos, realizados en los siguientes lugares:\r\nÍtem\r\nLugar\r\nCantidad\r\n1\r\ncañar\r\n2\r\n2\r\nbiblian\r\n2\r\n3\r\nazogues\r\n1\r\nPasamos la noche en cañar \r\n4 de octubre del 2013 (azogues)\r\nSalimos 07: am  dirección la troncal   7 mantenimientos, realizados en los  siguientes lugares\r\nÍtem\r\nLugar\r\nCantidad\r\n1\r\ntroncal\r\n4\r\n2\r\nTroncal suya\r\n1\r\n3\r\nGualle turo  troncal\r\n2\r\n\r\nNovedades:\r\nEl vehiculo con numero de vin  4XATH76A9D4315562  tiene doblado el protector de la parte de debajo de motor  es el segundo cambio de aceite  este vehículo  tiene desgastadas  las ruedas traseras   en un 70 %,  también se prendió la luz del motor cuando se aceleraba a 90 kilómetros por hora.\r\nEl vehiculo con numero de vin 4XATH76A7D4315575 tiene dañado el cable de inyección, Se le iso el cambio de  aceite y de filtro de aceite, tiene dañado el tapón de cambio de aceite del motor. Se le puso un tapón  nuevo en la caja frontal\r\nEl vehiculo con numero de vin 4XATH765D4315591  este vehículo se le cambio el caucho del eje trasero   y por lo cual no se realizó el mantenimiento respectivo.\r\n\r\nAtentamente: \r\nMarco Llumiquinga', '2013-10-18 20:38:03'),
(8, '2013-10-15 00:00:00', '2013-10-18 00:00:00', 23, 'Bolivar', 250.00, '15  OCTUBRE  2013\r\nSalida de QUITO  las 1:30 pm, y nos dirigimos  a  realizar  los mantenimiento   establecido  en la provincia  de Guaranda \r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n15/10/2013\r\nGuaranda \r\nBolívar \r\n3\r\nObservación: sin novedad. \r\nY luego nos dirigimos a  salinas a  seguir  con mantenimiento establecido en cronograma.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n15/10/2013\r\nGuaranda \r\nSalinas  \r\n3\r\nObservación: sin novedad. \r\n16 OCTUBRE  2013\r\nNos dirigimos a san pablo  a realizar el  mantenimiento.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n16/10/2013\r\nGuaranda \r\nSan pablo \r\n5\r\nObservación: sin novedad. \r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n16/10/2013\r\nGuaranda \r\nChimbo \r\n4\r\nObservación: Este vehículo:4XATH76A0D4315563 tiene un sonido, en la parte  trasera del motor , cuando el vehículo  está en marcha . \r\n17 OCTUBRE 2013\r\nNos dirigimos a caluma  a realizar el  mantenimiento.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n17/10/2013\r\nGuaranda \r\nCaluma \r\n5\r\nObservación: Este vehículo:4XATH76A2D4315564  a este vehículo , le faltaba  aceite en el motor .\r\nLos tornillos de la rueda  trasera  fueron sustituidos por otros tornillos, porque la rueda se salió del vehículo. \r\n18 OCTUBRE 2013\r\nNos dirigimos a Ambato  a realizar el  mantenimiento.\r\nFecha \r\nLugar \r\nProvincia \r\nVehículo \r\n18/10/2013\r\nAmbato \r\nAmbato \r\n2\r\nObservación: Este vehículo:4XATH76A8D229077 Solo se realizó el chequeo respectivos porque no se encendida , y se le reviso el cable de las bujías y se limpió las bujías y se comprobó  el pase de gasolina al motor , luego de realizar estos chequeos respectivos el vehículo se encendió. Y no se realizó el cambio de aceite   \r\n\r\nVEHICULOS DAÑADOS \r\n Este vehículo 4XATH76A4D2290050 en Guaranda  presenta el siguiente daño no se enciende, se chequeo los cables de la bujía, el paso de gasolina del tanque al motor,  solo nos faltó chequear las bujías, del motor  y realizo el cambio del aceite.\r\nEste vehículo tiene que trasportarlo a QUITO para hacer las revisiones  respectivas  y  solucionar el daño del dicho vehículo.  ', '2013-10-21 20:08:54'),
(9, '2013-10-16 00:00:00', '2013-10-17 00:00:00', 7, 'Cotopaxi, Pichincha', 100.00, 'Informe Viaje Mantenimiento\r\nInforme No: IV-2013-09\r\nQuito, 18 de Octubre del 2013\r\nFecha Salida: 16 de Octubre del 2013\r\nFecha Retorno: 17 de Octubre del 2013\r\nTécnicos: Eduardo Villota, Richard Catagña\r\nProvincias de Destino: Cotopaxi, Pichincha\r\nNro. De Vehículos: 7 vehículos\r\nValor de Caja: 100,00\r\nHistorial de Mantenimientos:\r\n16 de Octubre del 2013 (Cotopaxi)\r\nSalida de Quito a las 06:30am con destino a Latacunga realizando manteamiento sin novedades a cinco vehículos, mantenimientos realizados en los siguientes lugares:\r\nÍtem\r\nlugar 		Cantidad\r\n1\r\nJosé Guango Bajo\r\n1\r\n2\r\nMulliquindil\r\n1\r\n3\r\nMulalillo\r\n1\r\n4\r\nSaquisili\r\n1\r\n5\r\nCusubamba\r\n1\r\nSalida de Latacunga con destino a Machachi para pasar la noche.\r\n17 de Octubre del 2013 (Pichincha)\r\nSalida de Machachi a las 7:00am  con destino a Tandapi (Santo Domingo) realizando manteamiento sin novedades a cinco vehículos, mantenimientos realizados en los siguientes lugares:\r\nÍtem\r\nLugar\r\nCantidad\r\n1\r\nTandapi\r\n2\r\nNovedades:\r\nS/N\r\nAtentamente:\r\nEduardo Villota', '2013-10-18 19:40:54'),
(10, '2013-10-22 00:00:00', '2013-10-22 00:00:00', 6, 'Chimborazo, Tungurahua', 60.00, '                                 POLARIS INFORME 22 OCTUBRE\r\n  Salidad de Quitó a las 6 am y nos dirigimos a Riobamba a realizar el mantenimiento \r\n 6 vehículo . 1 cambio de aceite en Ambato  .5 en Riobamba  reparación del  caucho de eje trasero.\r\n\r\nRIOBAMBA \r\nEste vehiculo 4XAT76A7D221077 tiene un degastes de los bocines de la cruceta de la rueda derecha, esto causa que la rueda se ubique a un lado vertical\r\n\r\n 4XATH76A4D2290792 reparación del caucho  no se realizó el cambio de aceite.\r\nEste caucho fue reparado  y cómo podemos  observar en la imagen.\r\n4XATH76AD4317665 Este vehículo se le reparo el caucho \r\nEste caucho del lado, izquierdo fue reparado, y se probó el vehículo  para ver sí el caucho resistía, este lado estaba más caliente que el otro .esto podría ser las consecuencia que los caucho se rompan, (tenía la punta fuera  de la caja de cambio)\r\n.\r\nEste 4XATH76A1D2290751  Reparación del caucho y no se realizó el cambio de aceite.\r\n                                   VEHÍCULO DAÑADO \r\n4XATH76A5D2293197 Este vehículo tenía salido el eje de la  rueda trasera. Y procedimos  a la reparación del daño, los rulimanes  estaban con fisuras. \r\nComo podemos observar el desgaste de pieza de este el vehículo hay que sustituir totalmente la pieza  .', '2013-10-25 17:49:49'),
